import React from 'react';
import Heading, {sum,sub,mult,div} from './Heading';


function App() {
    return (
        <>
        <Heading />
        <h4>The sum is {sum(4,5)}</h4>
        <h4>The sub is {sub(9,5)}</h4>
        <h4>The mult is {mult(4,5)}</h4>
        <h4>The div is {div(4,5)}</h4>
        </>
    );
}


export default App;
